import React from "react";

const SignUpUserOrRider = () => {
    return(
        <div>
            <p>Sign Up as a User</p>
            <p>Or</p>
            <p>Sign Up as a Runner</p>
        </div>
    )
}

export default SignUpUserOrRider;
